import { render } from "react-dom";
import {
  BrowserRouter,
  Routes,
  Route,
  Switch
} from "react-router-dom";
import Main from "./Main";
import Header from "./Header";


const rootElement = document.getElementById("root");
render(
  <BrowserRouter>
    <Routes>
      <Switch></Switch>
       <Route path="/" element={<Main />}>
        </Route>
      {/* <Route path="/news" element={<News />} /> */}
     </Routes>
  </BrowserRouter>,
  rootElement
);
